import React, { FC } from 'react';
import styles from './Home.module.scss';
import Brands from '../Brands/Brands';
import ChangeTitle from '../Change_title/Change_title';
import ShoesCard from '../shoesCard/shoesCard';
import Youtube from '../youtube/youtube';
import RandomBrand from '../RandomBrand/RandomBrand';
import Sale from '../Sale/Sale';

interface HomeProps {}

const Home: FC<HomeProps> = () => {
  return(
    <main className={styles.Main}>
    <ChangeTitle />
    <Sale />
    <RandomBrand/>
    <Youtube />
    {/* <Brands/> */}
    <ShoesCard brand={'Air Jordan'} size={42} price={399} image={'Some-IMG'}/>
    <ShoesCard brand={'Nike'} size={43} price={499} image={'Some-IMG'}/>
    <ShoesCard brand={'Adidas'} size={46} price={399} image={'Some-IMG'}/>  
    </main>
  );
}

export default Home;
